var serializeWidgetMap = function(items) {
    console.log(items);
};

$('.grid-stack').on('change', function(event, items) {
  for (i = 0; i < items.length; i++) {
    save_properties_widget(items[i]);
}
serializeWidgetMap(items)
});

// Example Tokenfield With Typeahead
  // ---------------------------------
  (function() {
    var engine = new Bloodhound({
      local: [
        {value :'browser'},{value :'chrome'},{value :'client'},{value :'css'},{value :'development'},{value :'firefox'},{value :'gecko'},{value :'gtk'},{value :'html'},{value :'http'},{value :'internet'},{value :'javascript'},{value :'mozilla'},{value :'web'},{value :'www'},{value :'xhtml'},{value :'xul'},{value :'active_record'},{value :'convention_over_configuration'},{value :'development'},{value :'framework'},{value :'gems'},{value :'mvc'},{value :'rails'},{value :'rapid_development'},{value :'ruby'},{value :'rubygem'},{value :'web'}
      ],
      datumTokenizer: Bloodhound.tokenizers.obj.whitespace('value'),
      queryTokenizer: Bloodhound.tokenizers.whitespace
    });

    // engine.initialize();

    $('#project_tags').tokenfield({
      typeahead: [null, {
        name: 'engine',
        displayKey: 'value',
        source: engine.ttAdapter()
      }]
    });
  })();

  function save_properties_widget(widget){
    var width = widget.width
    var height = widget.height
    var x = widget.x
    var y = widget.y
    var id = widget.id
    var obj={}
    obj['_method']="put"
    obj['widget'] = {"id" : id, "width" : width, "height" : height, "pos_x" : x, "pos_y" : y}

    $.ajax({
    type: "PUT",
    dataType: "script",
    url: window.location.href + "/widgets/" + id,
    contentType: 'application/json',
    data: JSON.stringify(obj)
    }).done(function( msg )
    {
        alert( "Data Saved: ", msg );
    });

  }


  $(".btn-reply").click(function(){
    $(this).parents(".comment-body:first").find(".comment-reply:first").show();
  });

    $(".btn-reply-close").click(function(){
      $(this).parents(".comment-body:first").find(".comment-reply:first").hide();
  });

    $("#project_use_open_hub_image").change(function(){
      $("#container-upload").toggleClass("hide");
      $("#container-openhub").toggleClass("hide");
    });
